func TestType_MarshalJSON_roundtrip(t *testing.T) {
	var (
		jsonValue = []byte(`"array"`)
		v Type
	)

	require.NoError(t, json.Unmarshal(jsonValue, &v))

	marshaled, err := json.Marshal(v)

	require.NoError(t, err)
	assertjson.Equal(t, jsonValue, marshaled)
}
